import React from "react";
import "./styles/portfolio.css";
import { Link } from "react-router-dom";
import Hero from "../components/hero";

const Home = () => {
  return (
    <section>
      <Hero />
      <h2>Heading 2</h2>
      <Link to="/progressive">Progressive</Link>
    </section>
  );
};

export default Home;
